import { useState, useContext } from "react";
import { UserContext } from "../context";

function Teacher13() {
  const teacher = useContext(UserContext);
  return (
    <div>
      <div>{teacher[12].name}</div>
      <div>{teacher[12].instrument}</div>      
      <img id='base64image'
       src={'data:image/jpeg;base64,' + teacher[12].image}
       style={{"width": "200px"}}
      />
      <div>{teacher[12].introduction}</div>
    </div>
  );
};

export default Teacher13;
